import React, { useEffect, useRef, useState } from "react";
import io from "socket.io-client";
import Cookies from "js-cookie";

const socket = io("http://localhost:5000", { transports: ["websocket"] });
const configuration: RTCConfiguration = {
  iceServers: [{ urls: "stun:stun.l.google.com:19302" }],
};

const MainPage: React.FC = () => {
  const [localStream, setLocalStream] = useState<MediaStream | null>(null);
  const peerConnectionRef = useRef<RTCPeerConnection | null>(null);

  useEffect(() => {
    return () => {
      localStream?.getTracks().forEach((track) => track.stop());
      socket.off("offer");
      socket.off("answer");
      socket.off("candidate");
      if (peerConnectionRef.current) {
        peerConnectionRef.current.close();
      }
    };
  }, [localStream]);

  const getUserId = () => {
    const userId = Cookies.get("userIdState");
    if (!userId) {
      alert("Сначала войдите в аккаунт");
      return;
    }
    socket.emit("auth", userId);
    getMedia(userId);
  };

  const getMedia = async (userId: string) => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({
        audio: true,
        video: false,
      });
      setLocalStream(stream);
      startCall(stream, userId);
    } catch (err) {
      console.error("Не удалось получить доступ к микрофону", err);
    }
  };

  const startCall = (stream: MediaStream, userId: string) => {
    // Создаем подключение
    const peerConnection = new RTCPeerConnection(configuration);
    peerConnectionRef.current = peerConnection;

    // Слушаем кандидатов ICE
    peerConnection.onicecandidate = (event) => {
      console.log(event)
      if (event.candidate) {
        socket.emit("candidate", {
          candidate: event.candidate,
          target: userId,
        });
      }
    };

    // Добавляем треки
    stream.getTracks().forEach((track) => {
      peerConnection.addTrack(track, stream);
    });

    // Создаем предложение (offer)
    peerConnection
      .createOffer()
      .then((offer) => peerConnection.setLocalDescription(offer))
      .then(() => {
        // Отправляем предложение через сокет
        socket.emit("offer", {
          sdp: peerConnection.localDescription,
          target: userId,
        });
      })
      .catch((err) => console.error(err));
  };

  // Устанавливаем обработчики событий сокета
  useEffect(() => {
    socket.on(
      "offer",
      (data: { sdp: RTCSessionDescriptionInit; sender: string }) => {
        if (!peerConnectionRef.current && localStream) {
          const peerConnection = new RTCPeerConnection(configuration);
          peerConnectionRef.current = peerConnection;

          localStream.getTracks().forEach((track) => {
            peerConnection.addTrack(track, localStream);
          });

          peerConnection.onicecandidate = (event) => {
            if (event.candidate) {
              socket.emit("candidate", {
                candidate: event.candidate,
                target: data.sender,
              });
            }
          };

          peerConnection
            .setRemoteDescription(new RTCSessionDescription(data.sdp))
            .then(() => peerConnection.createAnswer())
            .then((answer) => peerConnection.setLocalDescription(answer))
            .then(() => {
              socket.emit("answer", {
                sdp: peerConnection.localDescription,
                target: data.sender,
              });
            })
            .catch((err) => console.error(err));
        }
      }
    );

    socket.on("answer", (data: { sdp: RTCSessionDescriptionInit }) => {
      const peerConnection = peerConnectionRef.current;
      if (peerConnection && !peerConnection.currentRemoteDescription) {
        peerConnection.setRemoteDescription(
          new RTCSessionDescription(data.sdp)
        );
      }
    });

    socket.on("candidate", (data: { candidate: RTCIceCandidateInit }) => {
      const peerConnection = peerConnectionRef.current;
      if (peerConnection) {
        peerConnection.addIceCandidate(new RTCIceCandidate(data.candidate));
      }
    });

    return () => {
      socket.off("offer");
      socket.off("answer");
      socket.off("candidate");
    };
  }, [localStream]);

  return (
    <>
      <section className="w-full h-full flex content-center items-center flex-col bg-cyan-500 mx-[500px] shadow-2xl shadow-black">
        <div className="flex flex-grow content-center items-center min-h-[200px] min-w-[200px] max-h-[200px] max-w-[200px]  mt-10">
          <div className="w-full h-full flex content-center  bg-anon bg-cover bg-no-repeat rounded-3xl "></div>
        </div>
        <div className="flex pb-10 hover:transition-all hover:opacity-80 flex-col items-center justify-center">
          <button
            onClick={() => {
              getUserId();
            }}
            className="bg-green-300 rounded-3xl text-3xl w-[250px] h-[40px] mb-5 mt-80 text-white"
          >
            Начать поиск
          </button>
          <p className="text-1xl">Количество пользователей онлайн:</p>
        </div>
      </section>
    </>
  );
};

export default MainPage;
